import React from 'react';
import { useSelector } from 'react-redux';

const TasksListContent = () => {
    const { tasks } = useSelector(state => state.getTasksReducer.tasks);

    console.log(tasks)

    return (
        {if(tasks) {
            tasks.forEach(task => {
                <h1>{task}</h1>
            })
        }}
    );
};

export default TasksListContent;
